ISLAMABAD, Jun 9 (APP): Chief Minister of Gilgit Baltistan Khalid Khursheed Thursday called on President Dr Arif Alvi here.
During the meeting, the chief minister briefed President Alvi regarding development projects and initiatives launched by government for welfare and prosperity of the people of Gilgit Baltistan.
